import React, {useState} from "react";
import { Container, Row, Col, Dropdown, DropdownButton } from "react-bootstrap";
import projects from "./Projects.json";
import Project from "./Project.jsx";

const Projects = () => {
	const [filter, setFilter] = useState("All");
useEffect(() => {
   alert(filter)
}, [filter])

	return (
		<Container fluid className="text-center bg-body-secondary">
			<Row className="mb-5">
				<Col>
					<h1>Projects</h1>
				</Col>
			</Row>
			<Row className="mb-3 mt-5">
				<Row>
					<DropdownButton id="dropdown-basic-button" title={filter}>
						<Dropdown.Item
							href="#"
							onClick={() => {
								setFilter("All");
							}}
						>
							All
						</Dropdown.Item>
						<Dropdown.Item
							href="#"
							onClick={() => {
								setFilter("BackEnd");
							}}
						>
							Back End
						</Dropdown.Item>
						<Dropdown.Item
							href="#"
							onClick={() => {
								setFilter("FrontEnd");
							}}
						>
							Front End
						</Dropdown.Item>
						<Dropdown.Item
							href="#"
							onClick={() => {
								setFilter("FullStack");
							}}
						>
							Full Stack
						</Dropdown.Item>
						<Dropdown.Item
							href="#"
							onClick={() => {
								setFilter("Other");
							}}
						>
							Other
						</Dropdown.Item>
					</DropdownButton>
					<Row>
						{(() => {
							if (filter === "All") {
								Object.values(projects.projects).forEach(project => {
									return <Project project={project} />;
								});
							} else {
								const filteredProjects =
									Object.values(projects.projects).filter(project => {
										return project.stack === filter;
									});
									filteredProjects.forEach(project =>{
									alert("y");
									  return <Project project ={project} />
									})
							}
						})()}
					</Row>
				</Row>
			</Row>
		</Container>
	);
};

export default Projects;
